const ProductItem = ({ product }) => {
  return (
    <>
      <div>
        <picture>
          <img
            src={product.img1}
            className="img-fluid"
            style={{ height: "200px" }}
          />
        </picture>
        <div>
          <p>{product.name}</p>
          <p>{product.price}</p>
        </div>
      </div>
    </>
  );
};

export default ProductItem;
